import React from "react";
import {  Route, Routes } 
        from 'react-router-dom'

import {NotFound} from '../404/404Page';
import Home from "../Home/Home";

function App() {
  return (
  <Routes>
    <Route path="*" element={<NotFound />} />
    <Route path="/" element={<Home />} />
  </Routes>
  );
}

export default App;
